import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Lol from './components/test.jsx'
import NavBar from './components/navbar.jsx'
import MyTable from './components/tables2.jsx'
import Search from './components/searchField.jsx'
import DropDown from './components/dropdownFilter.jsx'


import 'react-table/react-table.css'

class App extends Component {
  render() {


    let { title } = this.props;
    return (

      <div className="App">
        <header>

        </header>
        <NavBar/>
        <Lol/>
        <MyTable/>
        <Search/>
        <DropDown/>
      </div>
    );
  }
}


App.defaultProps = {
  title: "TITRE"
};

export default App;
